<?php

namespace App\J3;

class FieldRenderer
{
    public static function fieldHtml($fieldContent){
        $a = "";
        $endA = "";
        $key = $fieldContent->getKey();
        $i = $fieldContent->i;
        $j = $fieldContent->j;

        if($fieldContent->isClickable()){
            $a = '<a href="index.php?x='.$i.'&y='.$j.'">';
            $endA = '</a>';
        }

        if($key == 'player'){
            return '<img style="width: 20px; height: 20px;" src="data:image/jpeg;base64,">';
        }

        if($key == 'green'){
            return $a.'<img style="width: 20px; height: 20px;" src="https://images-na.ssl-images-amazon.com/images/I/217IhwZpIIL.jpg">'.$endA;
        }

        if($key == 'gray'){
            return '<img style="width: 20px; height: 20px;" src="https://sherwin.scene7.com/is/image/sw/color-swatch?_tparam_size=250,250&layer=comp&_tparam_color=C2C0BB">';
        }

        if($key == 'goat'){
            return $a.'<img style="width: 20px; height: 20px;" src="data:image/png;base64,">'.$endA;
        }

        return "&nbsp";
    }
}